// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';

// Defining placeholder components for the other pages
const ServiceRequestPage = () => <h2>Service Request Page</h2>;
const ProblemManagementPage = () => <h2>Problem Management Page</h2>;
const IncidentManagementPage = () => <h2>Incident Management Page</h2>;
const ChangeManagementPage = () => <h2>Change Management Page</h2>;

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Define routes for each of the pages */}
        <Route path="/" element={<HomePage />} />
        <Route path="/service-request" element={<ServiceRequestPage />} />
        <Route path="/problem-management" element={<ProblemManagementPage />} />
        <Route path="/incident-management" element={<IncidentManagementPage />} />
        <Route path="/change-management" element={<ChangeManagementPage />} />
      </Routes>
    </Router>
  );
};

export default App;
